import { Link, useParams } from 'react-router-dom';

const CommentGoBack = () => {
    const { id } = useParams();
    return (
		<div className="commentGoBack">
			<Link to={`/blogs/${id}`}>Back to Blog</Link>
		</div>
	);
}

export default CommentGoBack;
